import React from "react";
import "./VideoList.css";

// APIkey=AIzaSyAtTWostq1MsBKVBHh6HeQ2bX6y6xj8YyE

export default function VideoList(props) {
  const APIkey = "AIzaSyAtTWostq1MsBKVBHh6HeQ2bX6y6xj8YyE";
  const playlistId = "PLjXBz6brb9YhM-UqVnm88WFNN5RiakvLo";

  const url = `https://youtube.googleapis.com/youtube/v3/playlistItems?part=snippet%2CcontentDetails&maxResults=40&playlistId=${playlistId}&key=${APIkey}`;

  useEffect(() => {
    fetch(url)
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
      });
  }, []);
  return (
    <div className="videos">
      <header className="video-list-header">
        <p>{props.videoAPI.name}</p>
      </header>
      <ul className="video-list">
        {props.videoAPI.videos.map((video) => {
          return (
            <li
              className="video"
              key={video.id}
              onClick={() => props.onClickTitle(video)}
            >
              {video.title}
            </li>
          );
        })}
      </ul>
    </div>
  );
}
